import ListItem from "./comp_listItem/listItem_comp";
const List = (todos) =>{
    return(
        <ul>
            {
                todos.todos.todos.todos.map(todo => todo.value)
            }
            <ListItem todos={todos} />
        </ul>
    )
}

export default  List;
